import axios from "axios";

export const getFiles = (search) => {
  return (
    axios.create({
      baseURL: "http://localhost:2019",
      headers: {
        "Content-Type": "application/json"
      },
    }).get(`/files/data?fileName=${search}`)
      .then((res) => res.data)
      .catch((error) => { throw error })
  )
};
